[[package]]
name = "advent-of-code-data"
version = "1.2.2"
summary = "Get your puzzle data with a single import"
dependencies = [
    "beautifulsoup4",
    "colorama; platform_system == \"Windows\"",
    "pebble",
    "python-dateutil",
    "requests",
    "termcolor",
    "tzlocal",
]

[[package]]
name = "beautifulsoup4"
version = "4.11.1"
requires_python = ">=3.6.0"
summary = "Screen-scraping library"
