summary = "Shims to make deprecation of pytz easier"
dependencies = [
    "tzdata; python_version >= \"3.6\"",
]

[[package]]
name = "requests"
version = "2.28.1"
requires_python = ">=3.7, <4"
summary = "Python HTTP for Humans."
dependencies = [
    "certifi>=2017.4.17",
    "charset-normalizer<3,>=2",
    "idna<4,>=2.5",
    "urllib3<1.27,>=1.21.1",
]

[[package]]
name = "setuptools"
version = "65.6.3"
requires_python = ">=3.7"
